Principais responsabilidades
• Analisar e desenvolver projetos de sistemas através de levantamento de requisitos;
• Programação em PHP, CSS, HTML, JavaScript;
• Frameworks VsCode, Laravel,  TailWind, VueJs,  BootStrap;
• Manipulação com banco de dados Sql, MySql, PostGress e Oracle através comandos e Query's no Pgadmin, Workbench e SqlDeveloper;
• Controle de versionamento GIT, GitLab / GitHub / Bitbucket / CodeCommit (plataforma de gerenciamento de projetos e construção softwares e aplicações);
•Cumprimento de objetivos e alcance de metas, assegurar a entrega das soluções quanto ao desenvolvimento, cumprindo dos padrões de qualidade e de atendimento referente aos sistemas da organização;
• Responder pelo cumprimento das políticas, processos e procedimentos, metas, e pelos prazos dos projetos de desenvolvimento;
• Garantir que todos os dados gerados estejam corretos e de conformidade.

Principais responsabilidades
• Gestão e infraestrutura tecnológica em ambiente organizacional, local e em nuvem (Amazon Web Services - IAM, EC2, RDS, S3, Lightsail, Lambda, CloudWatch, Organizations, Route 53, WAF, GuardDuty, Firewall Manager, EBS, Cloud9, CodeCommit, Device Farm); 
• Analisar e desenvolver projetos de sistemas através de levantamento de requisitos;
• Coordenar e desenvolver sistemas (Web e Corporativo); 
• Programação em Java, PHP, CSS, HTML, JavaScript;
• Frameworks VsCode, Laravel, VueJs, Angular, BootStrap;
• Manipulação com banco de dados MySql e Postgress através de Query no Pgadmin e Workbench;
• Controle de versionamento GIT e GitHub / Bitbucket / CodeCommit;
• Administrar Sistemas, apresentando soluções seguras para a racionalização de equipamentos e recursos humanos com inovações tecnológicas;
• Gerenciamento, desenvolvimento em equipe, teste e implantação de Sistemas para atender as necessidades da Organização;
• planejar e acompanhar as atividades relativas ao desenvolvimento dos sistemas, atendendo os padrões de qualidade;
• Liderar equipes multidisciplinares, contratando, motivando, avaliando o desempenho, fornecendo feedback e orientando na resolução de conflitos;
•Cumprimento de objetivos e alcance de metas, assegurar a entrega das soluções quanto ao desenvolvimento, cumprindo dos padrões de qualidade e de atendimento referente aos sistemas comercializados;
• Responder pelo cumprimento das políticas, processos e procedimentos, metas, e pelos prazos dos projetos de desenvolvimento;
• Planejar e acompanhar projetos estratégicos e diretrizes;
• Representar, responder e assumir responsabilidade pela área de atuação perante clientes internos, externos e diretoria; 
• Negociar com o cliente e diretoria, propondo soluções e decidindo as melhores alternativas para o produto e empresa de acordo com sua área de atuação; 
• Garantir que todos os dados gerados estejam corretos e de conformidade;

Principais responsabilidades:
• Gestão da infraestrutura tecnológica em ambiente organizacional (Datacenter, Servidores, Softwares e Web);
• Coordenar o desenvolvimento de sistemas (Web e Corporativo);
• Administrar Sistemas, apresentando soluções seguras para a racionalização de equipamentos e recursos humanos com inovações tecnológicas;
• Gerenciamento e desenvolvimento de sistemas em equipe, bem como, testes e implantação de Sistemas para atender as necessidades da Organização;
• Programação em Java, JavaEE, Hibernet, CSS, HTML, JavaScript utilizando Eclipse, Git e GitHub;
• Manipulação com banco de dados DB2 (AS400) por comando Sql.
• Desenvolver, Conduzir e Participar de reuniões de Grupos de Trabalhos;
• Coordenar e direcionar suporte às associadas e aos departamentos da associação;
• Preparar relatórios gerenciais;
• Conduzir manutenções preventivas e corretivas no ambiente organizacional;
• Planejar e aplicar treinamentos para colaboradores de acordo com as necessidades;
• Identificar e desenvolver inovações tecnológicas no ambiente de trabalho;
• Visitas técnicas às empresas associadas, com objetivo de orientar sobre necessidades, dificuldades na integração dos sistemas – para melhoria no processo de comunicação dos dados – associada X associação e vice-versa;
• Planejamento e elaboração de Previsão Orçamentária;
• Participação regular em eventos e comitês de trabalho para debates de temas relacionados T.I.

Principais responsabilidades:
• Gestão da infraestrutura tecnológica em ambiente organizacional (Datacenter, Servidores, Softwares e Web);
• Gerenciar, desenvolver e efetuar manutenção de sistemas (ERP Corporativo) em Clipper;
• Manipulação com banco de dados Sql em linha de comando.
• Administrar sistemas, apresentando soluções seguras para a racionalização de equipamentos e recursos humanos com inovações tecnológicas;
• Gerenciar, coordenar e executar suporte aos colaboradores nos departamentos da Organização;
• Confeccionar relatórios gerenciais;
• Planejar, treinar os colaboradores de acordo com as necessidades;
• Desenvolver e aplicar inovações tecnológicas no ambiente de trabalho.

